window.bookSummaryJSON = "<p><b>My plan was simple… return to Floodborn, enroll in the new academy, and earn the throne, all while returning the fae to our former glory and claiming my birthright.</b></p> <p>And yet nothing has been simple since the moment I arrived. Part of me should have known, and the other part blames the four men I can't seem to escape.</p> <p>Raiden. Kryll. Brody. Cassian.</p> <p>Each is more frustrating than the next, and all add up to nothing but chaos and distraction, neither of which I can afford. Not when my past and present are colliding, my secrets exposed in the process.</p> <p>But they underestimate me, every single one of them. And I'm determined to prove them wrong. Because it's a part of me, it's in my blood.</p> <p>And that crown… is mine.</p>"; 
